import * as React from "react";

import { Owner } from './game_logique'

export type CellProps = {
  onClick: () => void;
  owner: Owner;
};

const Cell: React.FC<CellProps> = ({owner, onClick}) => {
  return (
    <td className="cell" onClick={cellProps.onClick}>
      {owner === 1 ? "X" : cellProps.cell === 2 ? "O" : " "}
    </td>
  );
};

export default Cell;
